import React from 'react';
import { Fab, Grid } from '@material-ui/core';

function MainControls(props) {
    return (
        <>
        <div style={{marginBottom: "10px", marginLeft: "40px", marginRight: "40px"}}>
            <Grid container>
                <Grid style={{marginTop:"10px"}}>
                    <Fab color="primary" size="small"> -1 </Fab>
                </Grid>
                <Grid item xs>
                    <Fab color="primary">Play</Fab>
                </Grid>
                <Grid  style={{marginTop:"10px"}}>
                    <Fab color="primary" size="small"> +1 </Fab>
                </Grid>
            </Grid>

        </div>
        <div>
            <Fab variant="extended" 
                color="primary"
                onClick={props.randomize}
            >
                Randomize Data
            </Fab>
        </div>
        </>
    );
}

export default MainControls;
